import { Box, Container, Typography,Paper } from '@mui/material';
import logo from './e60c1b 1.png';
import React from 'react';

function Footer(props) {
    return (
        <Container>
            <img src={logo} alt="logo" />
            <Typography variant='subtitle1'>{`Big ideas in small packages 
            Start learnign now `}
            </Typography>
            <Box style={{position: 'absolute'}}>
                <Paper>
                    <div>Editorial </div>

            </Paper>
            <div><p> &copy; Blinkist 2021 Sitemap   |   Imprint   |   Terms of Service   |   Privacy Policies</p></div>
            </Box>
        </Container>
    );
}

export default Footer;
